import{_ as a}from"./chunks/index.VAya1KE4.js";import{c as s,o as t,G as p,k as e}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const g=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":5297,"idList":[504621,504570,504440,501214,503614,501157,501213,6489,3386,1058,1433,1056,1220,1498,503613,503612,4074,4073,500207,1290,502928,502927,5111,1627,502306,500987,501624,2404,501625,501626,2142,4334,6180,59,75,1057,501441,4081,500419,5020,500291,5865,500286,6937,500673,4780,5494,3875,3564,3276,1360,2040,57,2123,2403,2124,55,111,1744,501212,500672,500605,500292,7257,6938,6594,6490,6285,5866,5493,5297,4781,4736,4333,4197,4148,3387,3275,2606,2125,2402,78,382,105,92,241,1221,54,644,56,61,112,76,79,1055,1291,1795,2415],"data":{"id":5297,"name":"莱依拉","summary":"莱依拉","icon":"https://uploadstatic.mihoyo.com/ys-obc/2022/10/24/4328207/f7f5c758e157cc6d6ca7b7a378d665e6_8346107013175588314.png","avatar":{"m":"https://uploadstatic.mihoyo.com/ys-obc/2022/10/24/4328207/3dc95e3951b36aeb49d41059d5776efd_8667875752106648413.png","pc":"https://uploadstatic.mihoyo.com/ys-obc/2022/10/24/4328207/a4f390825cedb8de3523a4bef5d91848_2327056787277072671.png"},"attrs":[["地区","须弥城"],["星级","四星"],["神之眼所属","须弥"],["元素","冰"],["武器","单手剑"],["生日","12月19日"],["所属","梨多梵谛学院"],["定位","护盾冰元素角色"],["武器类型","单手剑"],["命之座","夜莺座"],["称号","绮思晚星"]],"destiny":[["<p>\\n<span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/c7fd13cc6cd2b572804551aab7c33728_3070343128594960240.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/c7fd13cc6cd2b572804551aab7c33728_3070343128594960240.png\\" style=\\"width: 40px;\\"></span></span></span>寐领围垣\\n</p>","<p>垂裳端凝之夜的安眠帷幕护盾的伤害吸收量提高20%。此外，施放垂裳端凝之夜时，将为队伍中附近不处于安眠帷幕护盾庇护下的所有角色生成伤害吸收量为安眠帷幕护盾35%的护盾，该护盾持续12秒，对冰元素伤害有250%的吸收效果。</p>"],["<p>\\n<span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/ad2be8bb68d79ef500247a9e544abd65_6336496592136867283.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/ad2be8bb68d79ef500247a9e544abd65_6336496592136867283.png\\" style=\\"width: 40px;\\"></span></span></span>归芒携信\\n</p>","<p>垂裳端凝之夜发射的飞星命中敌人时，为莱依拉恢复1点能量。每枚飞星至多通过这种方式为莱依拉恢复一次能量。</p>"],["<p>\\n<span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/f0732d7e0e76b1ae10c691266fb77811_5831675912489091968.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/f0732d7e0e76b1ae10c691266fb77811_5831675912489091968.png\\" style=\\"width: 40px;\\"></span></span></span>长宵宣秘\\n</p>","<p>垂裳端凝之夜的技能等级提高3级。至多提升至15级。</p>"],["<p>\\n<span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/f697049235ca1c077843251cd9e0837f_3786218508818451666.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/f697049235ca1c077843251cd9e0837f_3786218508818451666.png\\" style=\\"width: 40px;\\"></span></span></span>星示昭明\\n</p>","<p>垂裳端凝之夜开始发射一轮飞星时，将为附近的队伍中所有角色赋予「启明」效果，使普通攻击与重击造成的伤害提升，提升值相当于莱依拉生命值上限的5%。「启明」效果至多持续3秒，将在造成普通攻击或重击伤害后的0.05秒后移除。</p>"],["<p>\\n<span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/39a3dffa5b75f694a5716b6a34b05f6d_2868088519017883129.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/39a3dffa5b75f694a5716b6a34b05f6d_2868088519017883129.png\\" style=\\"width: 40px;\\"></span></span></span>悬神系流\\n</p>","<p>星流摇床之梦的技能等级提高3级。至多提升至15级。</p>"],["<p>\\n<span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/b45eb51d6acff51b4b4ffb7a70131266_6147640192325725207.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px;\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/372312395/b45eb51d6acff51b4b4ffb7a70131266_6147640192325725207.png\\" style=\\"width: 40px;\\"></span></span></span>曜光灵炬\\n</p>","<p>垂裳端凝之夜的飞星造成的伤害提升40%，星流摇床之梦的星光弹造成的伤害提升40%。此外，垂裳端凝之夜产生晚星的间隔时间减少20%。</p>"]],"skill":[{"title":"普通攻击·熠辉轨度剑","desc":"普通攻击\\n进行至多三段的连续剑击。\\n\\n重击\\n消耗一定体力，瞬间向前方挥出两剑。\\n\\n下落攻击\\n从空中下坠冲击地面，攻击下落路径上的敌人，并在落地时造成范围伤害。","icon":"https://uploadstatic.mihoyo.com/ys-obc/2022/10/25/4328207/8407be11122ae8de1c838ddcadd7dd28_8296601304699639074.png"},{"title":"垂裳端凝之夜","desc":"展开安眠帷幕护盾，并造成冰元素范围伤害。\\n安眠帷幕护盾的伤害吸收量受益于莱依拉的生命值上限，并对冰元素伤害有250%的吸收效果。 展开护盾时，为莱依拉施加短暂的冰元素附着。\\n\\n晚星与飞星\\n安眠帷幕护盾在持续期间内，将每1.5秒产生1枚依附其上的晚星；处于该护盾庇护下的角色施放元素战技时，也将产生2枚晚星，每0.3秒至多通过这种方式产生一次晚星，至多同时拥有4枚晚星。\\n安眠帷幕护盾的晚星达到4枚后，若附近存在敌人，晚星将转化为自行索敌的飞星依次发射，对命中的敌人造成冰元素伤害。\\n安眠帷幕护盾持续时间结束或被破坏时，晚星将会一同消失。若已经转换为飞星开始发射，飞星将继续存在直至这一轮发射完毕。\\n\\n一轮飞星全部发射完成之前无法产生新的晚星。\\n\\n「我与她像两位未曾谋面的神匠，同坐在一个椅垫上，同描绣一朵梦之花。」","icon":"https://uploadstatic.mihoyo.com/ys-obc/2022/10/25/4328207/66b57a8f77a8ba7cb513636183e76f89_6992946820849717388.png"},{"title":"星流摇床之梦","desc":"释放帮助入眠的饰梦天球，持续发射星光弹攻击领域内的敌人，造成冰元素伤害。\\n星光弹命中后，将为附近的安眠帷幕护盾产生1枚晚星。每个安眠帷幕护盾每0.5秒至多通过这种方式获得1枚晚星。\\n\\n「睡吧，睡吧，我知道那诸多星轨在你梦中，诸多命运在你朦胧的睡眼前展露。」","icon":"https://uploadstatic.mihoyo.com/ys-obc/2022/10/25/4328207/7275a278aff3a1783712b102acde1d11_1095986423415776482.png"},{"title":"如光骤现","desc":"安眠帷幕护盾在存在期间，每获得一枚晚星时，将产生深眠效果：\\n·处于安眠帷幕护盾庇护下的角色，护盾强效提升6%；\\n·该效果至多叠加4次，持续直到安眠帷幕护盾消失。","icon":"https://uploadstatic.mihoyo.com/ys-obc/2022/10/25/4328207/755c8ecc9ac97d554e03f2d1073ec866_7602421380821071839.png"},{"title":"勿扰沉眠","desc":"垂裳端凝之夜发射的飞星造成的伤害提高，提高值相当于莱依拉生命值上限的1.5%。","icon":"https://uploadstatic.mihoyo.com/ys-obc/2022/10/25/4328207/1fbea089be855796901885a88d94adce_7801121695401265566.png"},{"title":"叠影的梦兆","desc":"合成角色天赋素材时，有10%概率获得2倍产出。","icon":"https://uploadstatic.mihoyo.com/ys-obc/2022/10/25/4328207/ffd8f2fc54b291e1c0f5eb61bb675de5_2942945970810855787.png"}]},"favModalLocalKey":"vitepress_game_ys_role_fav_modal","favLocalKey":"vitepress_game_ys_role_fav"},"relativePath":"game/ys/role/5297.md","filePath":"game/ys/role/[pkg].md"}'),c={name:"game/ys/role/5297.md"},r=Object.assign(c,{setup(i){return(o,d)=>(t(),s("div",null,[p(e(a))]))}});export{g as __pageData,r as default};
